import React from "react";

export const Header = () => {
  return (
    <div>
      <header className="header">
        <i className="fas fa-dove"></i>
        <h1>Chirper</h1>
        <ul>
          <li>Post</li>
          <li>Users</li>
          <li>Profile</li>
          <li>Logout</li>
        </ul>
      </header>
    </div>
  );
};
